import { Container, Typography } from '@mui/material';

export default function App({ children }) {
  return (
    <Container maxWidth="md" sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>
        AutoML Assistant
      </Typography>
      {children}
    </Container>
  );
}
